INSERT [dbo].[Venue] ([Id], [Name], [Description], [Telephone], [Address], [latitude], [longitude]) VALUES (2, N'Dubai', N'Dubai is a city within the United Arab Emirates, placed within the emirate. The emirate of dubai is found on the southeast coast of the Persian Gulf and has the largest population within the UAE (2,106,177) and therefore the second-largest land territory by area (4,114 km2) after Abu Dhabi. Abu Dhabi and Dubai are the only 2 emirates to possess veto power over essential matters of national importance within the country''s legislature. The city of Dubai is found on the emirate''s northern lineation and heads up the Dubai-Sharjah-Ajman metropolitan space. As of 2012, Dubai was the 22nd most expensive city in the world and the most expensive city in the Middle East. Dubai was rated as one of the best places to live in the Middle East by U.S. global consulting firm Mercer There square measure 52 establishments in Dubai that supply higher education programs, and they are classified into 3 categories; federal institutions, institutions within the Free Zones and establishments outside the Free Zones. the foremost popular field of study among students in Dubai is Business (42% of students), followed by Society, Law and religion (19%).', N'+441315104271', N'Roda Al Bustan,Casablanca St.Al Garhoud Road, P.O.Box 30880, Dubai, UAE', 25.247954, 55.345317)
