INSERT [dbo].[Conference] ([Id], [Name], [Description], [ShortDescription], [Active], [FK_VenueId], [startDt], [endDt], [brochure], [SpeakerList], [shortImageUrl], [DisplayId], [ConfEmail]) VALUES (8, N'Global summit on Nursing and medical devices expo', N'Nursing is the protection, promotion, and optimization of health and abilities, prevention of illness and injury, through the diagnosis and treatment of humans. Nursing practice is both a science and an art. It requires scientific skill yet demands a strong background in the social sciences and humanities. Nursing makes a significant contribution to the health maintenance, health promotion and well-being of individuals, local communities and populations. A major challenge for current and future nursing practice, education and management is to address health for all and work towards equity and access to health care. Nursing Conference aims to explore advances in nursing practice, management and education in relation to health disparities as well as a breadth of other topics. WNC will provide an opportunity for nursing practitioners and educators to exchange research evidence, models of best practice and innovative ideas. Nursing Conference aims to discover advances in health practice, management and education in relation to health disparities as well as a breadth of other topics. The conference will facilitate a series of discussions about state-of-the-art processes, organizational transitions, analytics, and technology innovation within the health industry and academia, regarding transformational care delivery and health management models. The conference experience is for anyone involved in the delivery, development and organization of nursing, midwifery and healthcare education, as well as those who actively engage in participating in educational programs. The conference, particularly welcomes contribution from faculty, nursing and midwifery educationalists, academic administrators, senior education managers, practitioners, researchers and students. Nursing Conference aims to discover advances in health practice, management and education in relation to health disparities as well as a breadth of other topics. According to the reports, total health care spending of France is 9.7% of GDP according to 2014 and estimated to increase of 10.5% by 2017. Health care expenditure of Europe is $152.2 billion and expected to increase to $180.8 billion by 2018.', N'Nursing Advancing and Leading in Global Health', 0, 2, CAST(N'2018-04-16T00:00:00.000' AS DateTime), CAST(N'2018-04-18T00:00:00.000' AS DateTime), N'c1_b1.docx', NULL, N'f19091d3-2a07-454b-8ae3-62daa953bfc1_2.jpg', N'Nursing_medical_devices_and_expo', N'nursing@scientificcognizance.com')
INSERT [dbo].[Conference] ([Id], [Name], [Description], [ShortDescription], [Active], [FK_VenueId], [startDt], [endDt], [brochure], [SpeakerList], [shortImageUrl], [DisplayId], [ConfEmail]) VALUES (9, N'Global Summit on Otolaryngology And Rhinology', N'Otolaryngology is a combined study of Otology and Rhinology or Ear, Nose and Throat. The Otolaryngology diseases can affect some of our most important senses, including hearing, smell and taste. As hearing and speech are important aspects of human development and this conference may offers a comprehensive otolaryngology study and the recent development and research in this area. “Cochlear Implants” & “Endoscopic sinus surgery” are the biggest recent development enabling deaf to gain sense of hearing and the surgery for Sino-nasal problems. Otolaryngology Conference provides the excellent opportunity to meet experts, exchange information, and strengthen the collaboration among Researchers from both academia and industry. Otolaryngology is an event designed in a way to provide an exclusive platform for new researchers, scholars, physicians, ENT surgeons, students and educators to present and discuss the most recent innovations, trends, and concerns, practical challenges encountered and the solutions adopted in the concerned field. ', N'Advanced Research and Clinical Aspects in Otolaryngology', 0, 2, CAST(N'2018-04-16T00:00:00.000' AS DateTime), CAST(N'2018-04-18T00:00:00.000' AS DateTime), N'c1_b1.docx', NULL, N'c7cf727e-4b93-4273-b731-bf15a59dc31b_1.jpg', N'Otolaryngology_and_Rhinology', N'otolaryngology@scientificcognizance.com')
INSERT [dbo].[Conference] ([Id], [Name], [Description], [ShortDescription], [Active], [FK_VenueId], [startDt], [endDt], [brochure], [SpeakerList], [shortImageUrl], [DisplayId], [ConfEmail]) VALUES (10, N'Global Congress and Expo on Vaccine and Vaccination Techniques', N'Cognizance Scientific warmly welcomes all participants across the globe to attend Global Congress on Vaccine and Vaccination Techniques is going to be held at Dubai, during April 16-18,2018. Vaccine congress is mainly focused on “Vaccines research and Advance approach towards vaccination techniques for global cause” and its agenda is to produce high quality current research and best practices highlighted keynote presentations, oral and posters abstracts.[split]  Vaccine congress gathers diverse disciplines involved in the research and development of vaccines and associated technologies for disease control through immunization. This global platform brings experts, Scientists, research scholars, academic and industry professionals to explore their work and enhance their skills for the improvement of our Scientific Community. Cognizance Scientific also provides an international exposure for young researchers and scholars through their research work by meeting expertise within the field of vaccines and enhancing their knowledge. The Conference comprises with symposium, workshops, Exhibitions, Young research forum, Poster sessions, renowned speakers and eminent keynote presentations. The global vaccines market is expected to grasp USD 48.03 Billion by 2021 from USD 32.24 Billion in 2017 at a CAGR of 8.3% from 2017 to 2021. The major factor driving the growth of this market are high prevalence of diseases, rising government and nongovernment funding for vaccine development, increasing investments by companies, and increasing focus on immunization programs', N'Vaccines research and Advance approach towards vaccination techniques for global cause Safety', 0, 2, CAST(N'2018-04-16T00:00:00.000' AS DateTime), CAST(N'2018-04-18T00:00:00.000' AS DateTime), N'c1_b1.docx', NULL, N'31b8f58a-cf19-4324-8997-214bbb22c672_4.jpg', N'Vaccine_and_Vaccination_Techniques', N'vaccine@scientificcognizance.com')
INSERT [dbo].[Conference] ([Id], [Name], [Description], [ShortDescription], [Active], [FK_VenueId], [startDt], [endDt], [brochure], [SpeakerList], [shortImageUrl], [DisplayId], [ConfEmail]) VALUES (11, N'International Conference and Expo on Nanotechnology', N'The Aim of Nanotechnology 2018 is to present the most recent analysis and results of scientists related to nanotechnology topics. This conference provides opportunities for delegates/speakers to exchange new ideas and application experiences face to face, to establish business or research relations additionally on realize world partners for future collaboration and with a target to support young personalities and their analysis abilities by giving a chance to fulfil the specialists within the field of Nano. We tend to hope that the conference results constituted important contribution to the knowledge in these up-to-date scientific fields. Nanotechnology 2018 could be an important platform for ascension international and knowledge base exchange at the forefront of technology needs. The conference covers all frontier topics of Nano and includes comprehensive lectures and invited talks by eminent personalities from round the world additionally to contributed papers every oral and poster presentations. Nanotechnology is the improvement and engineering of devices therefore small that they are measured on a molecular scale. This developing field involves scientists from many alternative disciplines, including physicists, chemists, engineers, information technologists, and material Researchers, similarly as biologists. Applied science is being to almost each field imaginable, alongside physics, magnetics, information technology, materials development and biomedicine. the global marketplace for nanotechnology products was valued at $22.9 billion in 2013 and raised to concerning $26 billion in 2014. This market is anticipated to achieve concerning $64.2 billion by 2019, a compound annual rate (CAGR) of 19.8% from 2014 to 2019. Qualifying as a technology that has the potential to own a major impact on the world economy, nanotechnology developments square measure reaching vital mass. the world nowadays is reaping the advantages of current generation commercialised nanotech solutions within the form of slimmer and lighter display screens, stronger, durable and self-healing construction materials, intelligent biocompatible compounds for smarter medication delivery, Lighter, stronger &, fuel efficient vehicles, cleaner energy generation, storage, usage, and interactive, antimicrobial, smart food and drug packaging with the power to sense organic chemistry and microorganism contaminants, Asia Pacific ranks as the fastest growing market with CAGR of pure gold over the analysis period, junction rectifier by significant R&D interest in applied science as a platform for enabling  performance and quality enhancements of factory-made products particularly in export oriented political economy that seeks to retain producing competitiveness and excellence within the international market.', N'Emerging New Innovation in the field of Nanotechnology', 0, 2, CAST(N'2018-04-19T00:00:00.000' AS DateTime), CAST(N'2018-04-21T00:00:00.000' AS DateTime), N'c1_b1.docx', NULL, N'fc3ca70b-b067-4e26-9b0c-bcc3c652e20e_5.jpg', N'Nanotechnology', N'nanotechnology@scientificcognizance.com')
INSERT [dbo].[Conference] ([Id], [Name], [Description], [ShortDescription], [Active], [FK_VenueId], [startDt], [endDt], [brochure], [SpeakerList], [shortImageUrl], [DisplayId], [ConfEmail]) VALUES (12, N'International conference and expo on  separation science and technology', N'Separation science and technology 2018 aims to promote scientific information interchange between academic scientists, research scholars and researchers to share their experiences and research results on all aspects of Separation Science. This conference also provides opportunities for the delegates to exchange new ideas and application experiences face to face, to establish business / research relations, and to find partners for future collaboration. World renowned scientists will address key developments and applications, productivity and financial challenges, and novel approaches related to separation science and analysis focusing on the latest innovations in technologies. . The scientific program will offer plenary lectures, submitted oral presentations and poster sessions. Outside the session lecture theatres, you will also find numerous exhibitors presenting their contributions. All honorable authors are kindly encouraged to contribute to and help shape the conference through submissions of their research abstracts, papers and e-posters', N'Current Advance in Separation Science and Technology', 0, 2, CAST(N'2018-04-19T00:00:00.000' AS DateTime), CAST(N'2018-04-21T00:00:00.000' AS DateTime), N'c1_b1.docx', NULL, N'61061e02-5d45-401f-91a9-2680026b719f_6.jpg', N'separation_science_and_technology', N'separationtechniques@scientificcognizance.com')
INSERT [dbo].[Conference] ([Id], [Name], [Description], [ShortDescription], [Active], [FK_VenueId], [startDt], [endDt], [brochure], [SpeakerList], [shortImageUrl], [DisplayId], [ConfEmail]) VALUES (13, N'International Conference on Smart Infrastructure and Construction', N'The International Conference on Smart Infrastructure and Construction will bring together world-leading academics and practitioners from the fields of infrastructure planning, asset management and sensing. The unique combination of fields and disciplines focusing on the power of smarter information will provide opportunities to confront persistent barriers and develop novel, proactive solutions. [split] Smart Infrastructure and Construction provides the excellent opportunity to meet experts, exchange information, and strengthen the collaboration among Researchers from both academia and industry. Smart Infrastructure and Construction is an event designed in a way to provide an exclusive platform for academics working in the fields of: geotechnical and structural engineering; structural health monitoring; asset management; city scale infrastructure planning and design; the use of smarter data in cities. [split] Decision makers and analysts from industry and government responsible for: design, construction and operation of infrastructure assets; asset management; specification and procurement of major infrastructure assets. [split] Smart infrastructure and construction is an emerging field of great potential, and Transforming the Future of Infrastructure through Smarter Information will be of interest to practitioners, asset owners and operators, consultants, contractors and academics with an interest in the area. [split] Who can attend? [split] [split] Contractors & Industry Associations[split] Strategic & Networking Planning[split] Infrastructure Development & Management[split] Highway & Network Management[split] Road Maintenance & Engineering[split] Asset Management & Maintenance[split] Contract Development & Management[split] Construction & Civil Engineer[split]', N'Building Up a Sustainable Infrastructure Networks', 0, 2, CAST(N'2018-04-19T00:00:00.000' AS DateTime), CAST(N'2018-04-21T00:00:00.000' AS DateTime), NULL, NULL, N'083dfe66-a0cd-4e1e-b8dd-c0847c69b0c0_homepage-grid.jpg', N'infrastructureandconstruction', N'infrastructure@scientificcognizance.com')
