INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (30, 11, N'Mary Mehrnoosh Eshaghian Wilner', N'University of California, USA', 0, N'Mary Mehrnoosh EshaghianWilner received a BS degree in Biomedical and Electrical Engineering 1985 MS degree in Computer Engineering 1985 Engineers degree in Electrical Engineering 1988 and PhD in Computer Engineering 1988 all from the University of Southern California USC. Dr Eshaghian Wilner is currently an Adjunct Professor of Electrical Engineering at the University of California Los Angeles UCLA. She is also a patent attorney admitted to the State Bar of California and the Washington DC Bar and is registered to practice before the United States Patent and Trademark Office.', N'20633fc5-cb6a-4a56-866c-6fd701bae7db_303editor_image.jpg', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (31, 11, N'Joao Paulo Figueiró Longo', N'Institute of Biological Sciences University of Brasília,Brazil', 0, NULL, N'f3e4bfd9-425c-4277-9b2f-410d0c5e74f9_citations.jpg', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (32, 11, N'Dr. Khalid Mujasam Batoo', N'King Abdullah Institute for Nanotechnology, Saudi Arabia', 0, N'Khalid Mujasam Batoo, received his Ph.D in Applied physics from, Aligarh Muslim University, India in 2009. He is at present Associate Professor at King Abdullah Institute for Nanotechnology, King Saud University, Riyadh, Saudi Arabia since 2010. His international acclaims comprise of an academic excellence award from Dover publications New York, U.S.A. in 1998, NANO-15, award at KSR Institutes, Tirchendode, Tamil Nadu India, 2015, and ICNA-III, by South Valley University, Qena, Egypt (2016). He is recipient of Junior Research fellowship Award from Inter University Accelerator Center, New Delhi India between 2007-2010. As principal investigator, he has in his credit a number of projects of international repute from National Plan For Science and Technology and King Abdul Aziz City for Science and Technology, Kingdom of Saudi Arabia. He has authored more than 56 research papers published in peer reviewed Journals of International commendation and more than 27 conference papers. He has supervised number of masters and graduate students. He is reviewer to number of scientific journals and is serving editor to three journals, Journal of Bioelectronics and Nanotechnology, Journal of Nanoscience and Nanotechnology and Asian Journal of Materials Chemistry, As an invited speaker he has delivered many talks on nanotechnology and its applications in various countries such as Egypt, Saudi Arabia, Hong Kong, USA, China, Turkey, Greece, India, etc.', N'8e11aff6-99dc-45cd-af3f-6a1cd8479b45_826584951Photo.jpg', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (35, 11, N'Claudio Nicolini', N'University of Genova, Italy', 0, N'Claudio Nicolini was born in Udine, Italy. He received the doctoral degree in physics from the University of Padua, in 1967. After serving as Adjunct Professor at the University of Bari, he moved for 17 years to the United States, of which he became citizen since 1974, and was originally at Brown University, MIT, and BNL. He then moved to Temple University School of Medicine, Philadelphia, where after a period of intensive training and research in pathology he became Associate Professor of Pathology and then Professor and Chairman of the Biophysics in 1976. In 1985, he was called as “eminent scientist” to the Chair of Biophysics of the University of Genoa, in Italy until 2012, where he was successively Director of Biophysics Institute, DISTBIMO and CIRSDNNOB. From 1993 until now is Life President of the Fondazione ELBA Nicolini and of the Nanoworld Institute. On 2008, has been elected as a Foreign Member of the Russian Academy of Sciences and on 2010 Honoris Causa Professor of Biophysics and Nanobiotechnology at Moscow State University. He was Chief Editor of Cell Biophysics (USA) , Science and Technology Advisor to Italian Prime Minister Craxi, Member of the National Science and Technology Council upon Parliament election, Scientific Director Industrial Consortium CIREF, Founder Technobiochip; President Polo National Bioelectronics , President Scientific Technological Park of Elba Island. He received several awards and prizes and has authored more than 480 publications in international scientific journals (SCI), 35 patents (WPI), 28 books and Series Editor in Bioelectronics (Plenum) and Nanobiotechnology (Pan Stanford). His main scientific activities concerned cancer research, biophysics and nanotechnology, pioneering world-wide chromatin structure-function, bioelectronics and nanobiotechnology.', N'2a21666d-92e0-49de-b8e8-598491c6f6e7_claudio.jpeg', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (36, 11, N'Maje Alhaji Haruna', N'University of Leeds, England', 0, N'Maje Alhaji Haruna has completed his mastersin Chemical Engineering at the age of 24 years from the University of Leeds. He is about to start his PhD in December 2015, he is currently workingas graduate assistant in the school of Chemistry Federal University Dutse, Nigeria. Maje attended many science and engineering conference within and outside Nigeria. He has a wide research interest in the field of energy, hydrogen production and wastewater treatment. Current research focused on the nanoparticle application for enhanced oil recovery. He has published many papers in reputed journals.', N'84f84ea9-c9cb-4ca8-a0e1-558816c870ea_Maje_Haruna.png', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (37, 11, N'Ahmed El-Hussein', N'National Institute of Laser Enhanced Science, Egypt', 0, N'Ahmed El-Hussein is awarded PhD in Laser science and Biotechnology from The National Institute of Laser Enhanced Science, Cairo University, Egypt in the 2010.  He/She holds a Master Degree (MSc) in Laser science and Biotechnology from The National Institute of Laser Enhanced Science, Cairo University, Egypt in the 2006, followed by a Bachelor’s Degree (BSc) in Chemistry- Zoology from Cairo University, Egypt. in the 1999. Currently, he/she is working as an Assistant Professor for National Institute of Laser Enhanced Science, Cairo University.', N'733452bc-9fe2-4684-8437-e3e80ec13054_generic-avatar.png', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (38, 10, N'Mworozi Edison Arwanire', N'Uganda Marty`S University Nkozi Uganda', 0, NULL, N'0776fcc7-d32f-498e-8fd9-2864eae9ff88_empty-face.png', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (39, 10, N'Giulio Tarro', N'Temple University                                                       USA  ', 0, N'Giulio Tarro graduated from Medicine School, Naples University (1962). Research Associate, Division of Virology and Cancer Research, Children’s Hospital (1965-1968), Assistant Professor of Research Pediatrics, College Medicine (1968-1969), Cincinnati University, Ohio. Oncological Virology Professor, Naples University (1972-1985). Chief Division Virology (1973-2003), Head Department Diagnostic Laboratories, (2003-2006). D. Cotugno Hospital for Infectious Diseases, Naples; Emeritus, 2006 -. Since 2007 Chairman Committee of Biotechnologies and VirusSphere, World Academy Biomedical Technologies, UNESCO, Adjunct Professor Department Biology, Temple University, College of Science and Technology, Philadelphia, recipient of the Sbarro Health Research Organization lifetime achievement award (2010). President Foundation de Beaumont Bonelli for Cancer Research', N'40643722-4156-456f-b32d-96611b5c136e_Giulio.JPG', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (42, 10, N'S. Louise Cosby', N'Queen’s University Belfast              Ireland', 0, N'Professor S. Louise Cosby (SLC) was appointed as Head of Virology Branch at the Agri-Food and Biosciences institute, UK, in 2015. She was Chair of Microbiology in Queen’s University Belfast from 2002 and remains an emeritus professor.  SLC is a Fellow of  Royal College of Pathologists (London) and Fellow of the Royal Society of Biology, UK. She has served/currently serves on  grant/editorial boards:  BBSRC, UK; Chair/member, Science Foundation Ireland; Forum and committee member British Society for Immunology, UK;  Associate Editor, Journal of Neurovirology, USA;  Review editor, Frontiers in Microbiology; External Assessor for Appointments and Promotions in Medical Microbiology, University of Malaysia', N'c86bf596-ff90-4657-b1e0-013a2abeafc5_Louise Cosby.jpg', 1)
INSERT [dbo].[ConferenceTeam] ([Id], [FK_ConferenceId], [Name], [Info], [Chair], [Biography], [ImageUrl], [FK_MemberType]) VALUES (44, 10, N'VEYSEL KAYSER', N'The University of Sydney   Australia', 0, N'Veysel Kayser is an Associate Professor in the Faculty of Pharmacy at the University of Sydney. He received his B.Sc. degree from Hacettepe University (Turkey) and his Ph.D. from the University of Leeds (UK). In addition, he performed post-doctoral research at the Max-Planck Institute (Germany) and at MIT (US). Before joining the University of Sydney, he was a senior scientist at MIT', N'9444008e-f39b-4746-aa8a-8999dc865070_VEYSEL KAYSER.jpg', 1)
